B.aj7=new A.hs("5. Data Sharing & Disclosure","We do not sell, rent, or share your personal information with third parties for marketing purposes. We may share data in the following circumstances:\n\n\u2022 Service Providers: Trusted third parties that help us operate the platform (e.g., analytics, hosting) under strict confidentiality agreements.\n\u2022 Legal Requirements: When required by law, regulation, or legal process.\n\u2022 Safety: To protect the rights, safety, or property of SolFight, our users, or the public.")
B.ajn=new A.hs("6. Blockchain Data","Transactions on the Solana blockchain are inherently public and immutable. Once recorded, on-chain data cannot be modified or deleted by SolFight or any party. Your wallet address and transaction history on-chain are visible to anyone.")
