B.ajk=new A.hs("9. Security","We implement industry-standard security measures including encrypted connections (HTTPS/TLS), secure smart contract architecture, and regular security audits. However, no system is 100% secure. You are responsible for safeguarding your wallet's private keys.")
B.aja=new A.hs("10. Children's Privacy","SolFight is not intended for anyone under the age of 18. We do not knowingly collect information from minors. If we learn that we have collected data from a minor, we will take steps to delete it promptly.")
